import { Router, Switch, Route} from 'react-router-dom';
import LoginPage from './pages/LoginPage';
import AdminFolder from './pages/AdminFolder';

export const Routes = () => {
    return (
        <Router>
            <Switch>
                <Route path="/">
                    <LoginPage />
                </Route>
                <Route path="/AdminFolder">
                    <AdminFolder />
                </Route>
            </Switch>
        </Router>
    )
}
